import * as react from 'react';
import {
  Typography,
  Stack,
  Button,
  Card,
  CardContent,
  CardHeader,
  Divider,
  Box,
  Grid,
  Paper,
} from '@mui/material';
import { useNavigate } from 'react-router-dom';

export default function Dashboard(): React.ReactElement {
  const navigate = useNavigate();
  return (
    <Box
      sx={{
        display: 'flex',
        direction: 'column',
        gap: 2,
        flex: 1,
        minHeight: 0,
        bgcolor: 'primary.main',
      }}
    >
      <Paper
        variant="outlined"
        sx={{
          display: 'inline-block',
          p: 2,
          width: '100%',
          height: '10px',
          bgcolor: 'background.paper',
          borderColor: 'divider',
          border: '1px solid ',
        }}
      >
        <Stack direction="row" alignItems="center" spacing={1} sx={{ width: '100%' }}>
          <Typography variant="h6" sx={{ flex: 1 }}>
            Overview
          </Typography>
          <Button variant="contained" sx={{ boxShadow: 'none' }} onClick={() => navigate('/live')}>
            Go live
          </Button>
        </Stack>
      </Paper>
    </Box>
  );
}
